import React from "react";
import {Form, Input} from 'antd'

const Register = () => {
  return (
    <>
      <div className="register-page">
        <Form>
            <Form.Item>
                <Input />
            </Form.Item>
        </Form>
      </div>
    </>
  );
};

export default Register;
